import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import Driver from "../agents/Driver";
import Passenger from "../agents/Passenger";

function Screen(props) {
  const [passengers, setPassengers] = useState([
    {
      id: "passenger1",
      position: { x: 100, y: 100 },
      destination: { x: 50, y: 40 },
      happyfactor: 3,
      speed: 0,
    },
    {
      id: "passenger2",
      position: { x: 50, y: 30 },
      destination: { x: 30, y: 50 },
      happyfactor: 2,
      speed: 0,
    },
    {
      id: "passenger3",
      position: { x: 160, y: 130 },
      destination: { x: 30, y: 40 },
      happyfactor: 5,
      speed: 0,
    },
    {
      id: "passenger4",
      position: { x: 100, y: 70 },
      destination: { x: 20, y: 90 },
      happyfactor: 4,
      speed: 0,
    },
  ]);
  const [drivers, setDrivers] = useState([
    {
      id: "driver1",
      position: { x: 50, y: 50 },
      destination: { x: 240, y: 100 },
      speed: 5,
      passenger: null,
      happyfactor: 4,
    },
    {
      id: "driver2",
      position: { x: 190, y: 100 },
      destination: { x: 60, y: 130 },
      speed: 4,
      passenger: null,
      happyfactor: 3,
    },
    {
      id: "driver3",
      position: { x: 60, y: 50 },
      destination: { x: 160, y: 30 },
      speed: 3,
      passenger: null,
      happyfactor: 2,
    },
  ]);
  console.log(drivers, "hello");
  console.log(passengers, "hello2");

  return (
    <div>
      <div className={styles.arena}>
        {drivers.map((driver) => (
          <Driver
            key={driver.id}
            position={driver.position}
            destination={driver.destination}
            speed={driver.speed}
            passenger={driver.passenger}
            happyFactor={driver.happyfactor}
          />
        ))}
        {passengers.map((passenger) => (
          <Passenger
            key={passenger.id}
            location={passenger.position}
            destination={passenger.destination}
            driver={passenger.driver}
            happyFactor={passenger.happyfactor}
          />
        ))}
      </div>
    </div>
  );
}

export default Screen;
